package com.kawpool.stratum.core.blocks;

import com.kawpool.stratum.shared.blocks.models.Block;
import com.kawpool.stratum.shared.blocks.models.BlockHeader;
import com.kawpool.stratum.shared.blocks.utils.BlockUtils;
import com.kawpool.stratum.shared.transactions.Transaction;
import com.kawpool.stratum.shared.transactions.TransactionIn;
import com.kawpool.stratum.shared.transactions.TransactionOut;
import org.apache.commons.codec.DecoderException;
import org.apache.commons.codec.binary.Hex;
import org.junit.jupiter.api.Test;

import java.nio.ByteBuffer;
import java.util.ArrayList;
import java.util.List;

import static com.kawpool.stratum.core.blocks.BlockUtilsTest.TEST_COINBASE_ADDRESS;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class BlockTest {
    @Test
    public void testGetDataWithMultipleTransactions() throws DecoderException {
        List<Transaction> transactions = new ArrayList<>();
        Transaction transaction = new Transaction(
                List.of(new TransactionIn()),
                List.of(new TransactionOut(TEST_COINBASE_ADDRESS, 5000 * 100_000_000L))
        );
        transactions.add(transaction);
        Transaction otherTransaction = new Transaction(
                List.of(new TransactionIn()),
                List.of(new TransactionOut(TEST_COINBASE_ADDRESS, 1000 * 100_000_000L))
        );
        transactions.add(otherTransaction);
        BlockHeader blockHeader = new BlockHeader(
                805306368,
                "00000004f37513866c6ead4a9a515f4e667453a3af30bb405f2fed8e8af1bd49",
                1648507529,
                "1d0be039",
                1145698
        );

        Block block = new Block(blockHeader, transactions);
        String blockDataHexadecimal = Hex.encodeHexString(block.getData());

        assertEquals(
                "",
                blockDataHexadecimal
        );
    }

    @Test
    public void testSetData() throws DecoderException {
        Block block = new Block();
        String data = "";
        block.setData(Hex.decodeHex(data));

        String blockDataHexadecimal = Hex.encodeHexString(block.getData());

        assertEquals(
                data,
                blockDataHexadecimal
        );
    }

    @Test
    public void testClone() throws DecoderException {
        Block block = new Block();
        String data = "";
        block.setData(Hex.decodeHex(data));
        Block clonedBlock = block.clone();

        clonedBlock.getTransactions().add(new Transaction());

        assertEquals(15, block.getTransactions().size());
    }

    @Test
    public void testSetData2() throws DecoderException {
        Block block = new Block();
        String data = "";

        block.setData(Hex.decodeHex(data));

        assertEquals(data, block.getDataHexadecimal());
    }
}
